   // const navigate = useNavigate()
    return ( 
        <div>
            <Link to="/quanlychamcong/quanlycalamviec/xaydungcalamviec/themcalamviec" className='btn btn-success'>
                Chấm Công
            </Link>
            <table className='table'>
            <thead>
                    <tr>
                        <th>Tên</th>
                        <th>Chức </th>
                        <th>Endtime</th>
                        <th>DAY</th>
                        <th>Tùy Chọn</th>
                    </tr>
                </thead>
                <tbody>
                    {
                       Nhansus.map(e => {
                        const correspondingChucvu = Chucvu.find((cv) => cv._id === e.Chucvu);
                        return <tr>
                            <td>{e.Hoten}</td>
                            <td>{e.Cccd}</td>
                            <td>{e.Mnv}</td>
                            <td>{e.Sdt}</td>
                            <td>{e.luong}</td>
                            <td>{correspondingChucvu ? correspondingChucvu.Tenchucvu : '-'}</td>
                            <td>
                                <Link to={'/quanlythongtinnhanvien/Chinhsua/&idns='+ e._id} className='btn btn-info btn-sm me-2'> 
                                    Chấm Công</Link>
                                <button className='btn btn-warning btn-sm' onClick={() => handleDelete(e._id)}>
                                    Chấm Lại</button>
                            </td>
                        </tr>
                       })
                    }
                </tbody>
            </table>
        </div>
     );
}
 
export default Chamcong;
